 import React from 'react';
import camp from '../image-asset/Camping.jpg';

const Card= props =>{
    return(
        <div className= "card-text-center">
            <div className= "overflow"></div>
                <img src= {camp} alt= "Camping"/>
        </div>

    );

}



export default Card;
